import React, { Component } from "react";
import "./Main.css";
import Booklist from "../Books/Booklist/Index";
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import BookEdit from '../BookEdit/Index'
class Main extends Component {
    render() {
      const { books } = this.props;
      return (
        <main className="appMain row">
        <div className="left_app col-md-2">
          <p className="texto1">que tal majo</p>
        </div>
        <BrowserRouter>
        <Switch>
        <Route
              exact
              path="/"
              render={() => {
                return (
                <Booklist books ={books}/>
               )}}
            />
        <Route
              path="/book/:id"
              render={props => {
                return (
                <BookEdit match={props.match} books = {books}/>
                )}}
                />
            <Route
              path="/genre"
              render={() => (
                <Booklist books ={books}/>
                )}
            />
         </Switch>
         </BrowserRouter>
        </main>
      );
    }
};


export default Main;
